"use strict";
import {app, BrowserWindow,ipcMain,Tray,nativeImage,globalShortcut} from "electron";
import installExtension, { VUEJS3_DEVTOOLS } from "electron-devtools-installer";
import * as path from "path";
let mainWin = null
let addwin = null
function createWindow(){
  mainWin = new BrowserWindow({
    width: 300,
    height: 400,
    minimizable:false,
    maximizable:false,
     autoHideMenuBar: true,
     icon:nativeImage.createFromDataURL('data:image/png;base64,'),
    resizable: false,
    frame:false,
    webPreferences: {
      enableRemoteModule: false,
      preload: path.resolve(__dirname, "common.js"),
      nodeIntegrationInSubFrames: false,
      nodeIntegrationInWorker: false,
      nodeIntegration: false,
      contextIsolation: true,
      nativeWindowOpen: true,
    },
  });
  mainWin.loadURL(process.env.WEBPACK_DEV_SERVER_URL);
  let icon = nativeImage.createFromDataURL('data:image/png;base64,')
  let trayIcon = new Tray(icon)
  trayIcon.setToolTip("My Task Book")
  trayIcon.on('click', () => {
    mainWin.isVisible()?mainWin.hide():mainWin.show()

  })
}

async function addWindow(){
addwin = new BrowserWindow({
    width: 290,
    height: 50,
    autoHideMenuBar: true,
    frame:false,
    resizable:false,
     icon:nativeImage.createFromDataURL('data:image/png;base64,'),

    webPreferences: {
      enableRemoteModule: false,
      preload: path.resolve(__dirname, "common.js"),
      nodeIntegrationInSubFrames: false,
      nodeIntegrationInWorker: false,
      nodeIntegration: false,
      contextIsolation: true,
      nativeWindowOpen: true,
    },
  });


await addwin.loadURL("http://localhost:8080/#/hello");
}
app.on("ready", async () => { 

 createWindow()
 globalShortcut.register('CommandOrControl+Q', () => {
  mainWin.isVisible()?mainWin.hide():mainWin.show()
  mainWin.isVisible()?addwin.hide():addwin.show()
})
await installExtension(VUEJS3_DEVTOOLS)
ipcMain.handle("common:openWindow", (event,data) => {
  addWindow()
  mainWin.hide()
  console.log("hide main window");
  // ipcMain.handle('ping',()=>data)
  });

});


